import React, { useEffect } from 'react'
import { useNavigation, useTheme  } from '@react-navigation/native';
import './Temps.css';
import { connect } from 'react-redux';
import { requestTemps } from '../Redux/actions'
import store from '../index'

const mapStateToProps = (state) => {
    console.log(state)
    return {
        main: state.requestTemps.main,
        isPending: state.requestTemps.isPending
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
      onRequestTemps: () => dispatch(requestTemps())
    }
  }

function Temps() {
    const navigation = useNavigation();
    
    return(
        <div className='App'> 
        <h1> <button className='botao' title="Next Screen" onClick={() => navigation.navigate('Details')}> Tela 2 </button></h1>
        <h2>
           <button className='botao'> Cidade 1</button>
           <button className='botao'> Cidade 2</button>
           <button className='botao'> Cidade 3</button>
        </h2>
        <div className='card'>
        <p>Local: </p>
        <p>Temperatura Atual: </p>
        <p>Temperatura Máxima: </p>
        <p>Temperatura Mínima: </p>
        <p><img src='' alt='ícone'/></p>
        </div>
        </div>
    )
    
}

export default connect(mapStateToProps, mapDispatchToProps)(Temps)
